  a portion of the New York, Delaware, Maryland, Virginia, and North Carolina coastlines,
  post-Hurricane Sandy (Sandy was an October 2012 hurricane that made landfall as
  an extratropical cyclone on the 29th), from remotely sensed, geographically referenced
  elevation measurements collected by Photo Science, Inc. (Delaware, Maryland, Virginia,
  and North Carolina) and Woolpert, Inc. (Fire Island, New York) using airborne lidar
